description:
Little Cowpoke is the first album ever released by Nickel Creek. At the time
when this album was recorded, Sean Watkins was 15 years old and both
Sara Watkins and Chris Thile were 11.

This is more of a kiddie-type album, however, die-hard NC fans will probably
enjoy it.


